import React from 'react';
import preloadergif from './images/quote.gif';
import { CustomPreloader } from 'react-preloaders';
import './App.css';
import { Container, Row } from 'react-bootstrap';
import Sakura from './images/sakura.jpg';

import Placard from './components/placard';
import Content from './components/content';

const toggleThemes = () => {
    if (theme === 'light-theme') {
      changeTheme('dark-theme');
      theme = 'dark-theme';
    } else {
      changeTheme('light-theme');
      theme = 'light-theme'
    }
  }

function App() {
  return (
    <div className="App">
    {/* <CustomPreloader time={3000}> */}
    <CustomPreloader time={0}>
      <img src={preloadergif} alt="" className="preloader" />
    </CustomPreloader>

    <header className="App-header" style={{
      backgroundImage: `url(${Sakura})`,
      }}>
    <Container id="container" className="sakura-theme">
      <Row>
        <Placard/>
        <Content/>
      </Row>
    </Container>
    </header>

    </div>
    );
  }

  export default App;
